import React from 'react';
import PropTypes from 'prop-types'; 

function FileName ({ file }) {
    return (
        <>
            <td className="file-name">{file.name} </td>
        </>
    )
}

FileName.propTypes = {
    file: PropTypes.object.isRequired
}

export default FileName
